import './Navbar.css';
import React,{useState,useEffect} from 'react';

function Navbar() {
    const [banana,setBanana] = useState("Hay");
    
    function setFunction(){
        setBanana("Ciao");
    }

    function consoleLog(){
        console.log(banana);
    }

    useEffect(()=>{
            consoleLog();
        },[banana]);

    return (
        <div>{()=>setFunction()}</div>
    )
}

export default Navbar
